import React from "react";
import Logo from "../img/slog_logo.png";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="container">
        <div className="logo">
          <img src={Logo} alt="" />
        </div>
        <div className="links">
          <Link className="link" to="/?cat=art">
            <h6>FOOD</h6>
          </Link>
          <Link className="link" to="/?cat=art">
            <h6>DAILY</h6>
          </Link>
          <Link className="link" to="/?cat=art">
            <h6>FASHION</h6>
          </Link>
          <Link className="link" to="/?cat=art">
            <h6>CINEMA</h6>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
